import React, { Component } from 'react';
import Cookies from "universal-cookie";




import './style/style.css';
import { Form, Button, Card, Container, Row, Col } from "react-bootstrap";

import Header from './header'
import Footer from './footer'
import Login from './login'

const header = <Header />;
const footer = <Footer />;
const login = <Login/>

class LayoutFile extends Component {
    constructor() {
      super();

      this.state = {
        loadComponent:login
      };
    }


    reginster()
    {
      alert('hello');
    }
    async checkLogin(){
      return true;
    }
    async componentWillMount()
    {


      const v = await this.checkLogin();
      if(v)
      {
        this.setState = {
          loadComponent:login 
        };

        if(document.URL == "http://" + "127.0.0.1" + ":3001/?register") 
        {
          alert("hello");
        }
      }
      else
      {
        this.setState = {
          loadComponent:login
        };
      }


      const cookies = new Cookies();
      cookies.set('uname', 'ved prakash', { path: '/' });
      cookies.set('password', '123456789', { path: '/' });

      console.log("uname: "+cookies.get('uname')); 
      console.log("password: "+cookies.get('password')); 


    }


    render()
    {
      return(
        <div>
        {header}





        <div className="mainContainer">

        {login}


        </div>







        {footer}
        </div>
      );
    }

}

export default LayoutFile;
